import { createStore } from 'redux'
import rootReducer from './../redux/reducers/index'

const initialState = {}

export const store = () =>{
  return createStore(
    rootReducer,
    initialState,
    // applyMiddleware(...middleware) // to add other middleware
  )
}

export const wrapper = createWrapper(store, { debug: true });
